jQuery.Loading = function(Bool,Mensaje)
{
    var Img ='data:image/gif;base64,';
    var Pintar = function(){
        if(document.getElementsByClassName("div-Loading").length === 0 ){
            $("body").append(
                $("<div/>",{class:"div-Loading"}).css({
                    position:"absolute",
                    top:"0px",
                    left:"0px",
                    width:($(window).width()-10)+"px",
                    height:($(window).height())+"px",
                    background:"rgba(255,255,255,.8)",
                    "z-index":9999
                }).append
                (
                    $("<div/>",{class:'div-Loading'}).css({
                        background: "url("+Img+") no-repeat center",
                        width:$(window).width(),
                        height:$(window).height()
                    }).append(
                        $("<h3/>").text(Mensaje)
                            .css({
                                color: "grey",
                                "text-align": "center",
                                font:"bold 2em verdana"
                            })
                    )
                )
            );
        }
    };
    var Despintar = function(){
        $(".div-Loading").remove();
    };
    switch(Bool){
        case true:
            Pintar();
            break;
        case false:
            Despintar();
            break;
    }
};